import React, { useEffect, useState } from 'react';

const TableData = () => {
    const [show, setShow] = useState(false);
    const [users, setUser] = useState([{}]);
    useEffect(() => {

        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
                setUser(data);
                setShow(true);
            })
    }, []);

    return (

        <>
           
            <h1>
                {show && 
                <h1>
                    <>

                    {
                        Object.keys(users).map((key, i) => (
                            
                            <select >
                                <option >{key}</option>
                                {
                                    Object.keys(key).map((keys,i)=>(
                                        <option >{users[key][i]}</option>
                                        ))           
                                    }
                                </select>
                        ))
                        
                        
                    
                            
                    }
                        
                    <center>
                    </center>
                    <div>

                    <form action="/sign" method ="post">
        <div class="mb-3 mt-3">
          <label for="subject" class="form-label">Subject:</label>
          <input type="text" class="form-control" id="email" value="abcd" placeholder="Enter Subject" name="subject"/>
        </div>
        <div class="mb-3">
          <label for="text" class="form-label">Text:</label>
          <input type="text" class="form-control" id="pwd" value="abcd" placeholder="Enter text" name="text"/>
        </div>
        <div class="mb-3">
          <label for="html" class="form-label">Html:</label>
          <input type="text" class="form-control" id="pwd" value="abcd"  placeholder="Enter html" name="html"/>
        </div>
        <button type="submit" class="btn btn-primary">Submit</button>
      </form>
     

                    </div>

                    </>
                </h1>
                }

            </h1>
        </>
    );
};

export default TableData;
